import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Upload Image
        </p>
        <button>ADD IMAGE</button>
        <p>
          Upload XML
        </p>
        <button>ADD XML</button>
    </div>
  );
}

export default App;
